import React from 'react';

import NavBar from '../components/NavBar/NavBar.js';

export default function SearchResults({navigation}) {
  return (
      <View>
          <Text>"SearchResults"</Text>
          <NavBar navigation={navigation} user={username}/>
      </View>
  )
}
